import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

function Coletivo() {
    return(
        <div className="Coletivo">
            <Navbar tab="Coletivo" />
            <h1>Coletivo</h1>
            <Footer />
        </div>
    )
}

export default Coletivo
